-- From the following table, write a SQL query to find the quickest goal at the EURO cup 2016, after 5 minutes. Return 'Quickest goal after 5 minutes'.
SELECT min (goal_time) AS "Most Quickestgoal after 5 minutes"               
FROM (SELECT match_no,goal_time FROM goal_details WHERE goal_time>5 GROUP BY match_no,goal_time order by goal_time)hh;




14. From the following tables, write a SQL query to count the number of matches played at each venue. 
Sort the result-set on venue name. Return Venue name, city, and number of matches. 


SELECT a.venue_name, b.city, count(c.match_no)
FROM soccer_venue a
JOIN soccer_city b ON a.city_id=b.city_id
JOIN match_mast c ON a.venue_id=c.venue_id
GROUP BY venue_name,city
ORDER BY venue_name;


15. From the following tables, write a SQL query to find the player who was the first player to be sent off at the tournament EURO cup 2016. 
Return match Number, country name and player name. 

SELECT match_no, country_name, player_name, 
booking_time as "sent_off_time", play_schedule, jersey_no
FROM player_booked a
JOIN player_mast b
ON a.player_id=b.player_id
JOIN soccer_country c
ON a.team_id=c.country_id
AND  a.sent_off='Y'
AND match_no=(
	SELECT MIN(match_no) 
	from player_booked)
ORDER BY match_no,play_schedule,play_half,booking_time;


16. From the following tables, write a SQL query to find the teams that have scored one goal in the tournament.
 Return country_name as "Team", team in the group, goal_for. 

SELECT country_name as "Team" ,team_group, goal_for
FROM soccer_team
JOIN soccer_country 
ON soccer_team.team_id=soccer_country.country_id
AND goal_for=1;

17. From the following tables, write a SQL query to count the number of yellow cards each country has received. 
Return country name and number of yellow cards.

SELECT country_name, COUNT(*)
FROM soccer_country 
JOIN player_booked
ON soccer_country.country_id=player_booked.team_id
GROUP BY country_name
ORDER BY COUNT(*) DESC;

61. From the following tables, write a SQL query to find those players who came into the field at the end of play. 
Return match number, country name, player name, jersey number and time in out.  

SELECT match_no,
       country_name,
       player_name,
       jersey_no,
       time_in_out
FROM player_in_out a
JOIN player_mast b ON a.player_id=b.player_id
JOIN soccer_country c ON a.team_id=c.country_id
WHERE time_in_out=
    (SELECT max(time_in_out)
     FROM player_in_out)
  AND in_out='I';

60. From the following table, write a SQL query to find the goal scored by each player according to their position. 
Return country name, position to play, and number of goals.


SELECT country_name,
       posi_to_play,
       count(*) AS "Number of goals"
FROM goal_details a
JOIN player_mast b ON a.player_id=b.player_id
JOIN soccer_country c ON a.team_id=c.country_id
GROUP BY country_name,
         posi_to_play
ORDER BY country_name;


59. From the following table, write a SQL query to find the results of penalty shootout matches. 
Return match number, play stage, country name and penalty score. 

SELECT match_no,
       play_stage,
       country_name,
       penalty_score
FROM match_details a
JOIN soccer_country b ON a.team_id=b.country_id
WHERE decided_by='P'
ORDER BY match_no;


58. From the following table, write a SQL query to find out which players scored against his own team by accident. 
